import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


import MainPage from "../MainPage/MainPage";
import Registration from "../Registration/Registration";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/registration">
            <Registration />
          </Route>
          <Route>
            <MainPage path="/" />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
